L'aumento dell'inflazione penalizza salari e pensioni, per questo occorre salvaguardare con un'azione congiunta tra il governo e l'Inps l'indennità di 290€ al mese per gli invalidi civili totali che rischiano di perderla.

Bisogna agire con urgenza.

@CantoneCarla, @RominaMura https://t.co/xQdSI10xEV

